import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Footer extends Component {
    render() {
        return (
            <div className="container">
                <div>
                    <Link to="" className="socialMedia"><i class="fab fa-facebook-f"></i></Link>
                    <Link to="" className="socialMedia"><i class="fab fa-twitter"></i></Link>
                    <Link to="" className="socialMedia"><i class="fas google-plus"></i></Link>

                </div>
            </div>
        );
    }
}

export default Footer;
